import "../css/Rank.css"
import axios from "axios"
// '/api/ranking'

const RankingPage = () => {
    //DB 데이터 가져오기
    const rankers = () => {axios.get('/api/data')}

    const fetchedDataFromDB = async () => {
        try {
            const res = await axios.get('/api/ranking');
            const data = res.data;

            console.log(data);
        }
        catch (error) {
            //오류 처리
            console.error(error);
        }
    }

    return(
        <div id = "ranking-wrapper">
            <h1>Hall of Honor</h1>
            <div>{rankers}
                </div> 
            <ul id = "ranks">
            {/* {
                arr.map(() => {<li>1</li>})
            }  */}
            </ul>
        </div>
    );
} 

export default RankingPage;
